[Parse] Don't construct DeclRefExpr in #if conditions (#7522)

This code should compile:

  func foo(FOO: Int, swift: String, Linux: Bool) {
  #if FOO && swift(>=3.0) && os(Linux)
    // do something
  #endif
  }

